import './App.css';
import { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'
class App extends Component{

  state={
    student1:{
      courseId:101,coursename:"react",fee:15000,
    },
    student2:{
      courseId:102,coursename:"react",fee:15000,
    },
    student3:{
      courseId:103,coursename:"react",fee:15000,
    }
  }


  render(){

    return(
      <div>
        <thead className='table table-stripped table-primary'>
          <tr>
            <th scope='col'>Id</th>
            <th scope='col'>name</th>
            <th scope='col'>fee</th>
          </tr>
          <tr scope='row'>
            <td>{this.state.student1.courseId}</td>
            <td>{this.state.student1.coursename}</td>
            <td>{this.state.student1.fee}</td>
          </tr>
          <tr scope='row'>
            <td>{this.state.student2.courseId}</td>
            <td>{this.state.student2.coursename}</td>
            <td>{this.state.student2.fee}</td>
          </tr>
          <tr scope='row'>
            <td>{this.state.student3.courseId}</td>
            <td>{this.state.student1.coursename}</td>
            <td>{this.state.student1.fee}</td>
          </tr>
        </thead>
      </div>
    )
    }
    }
export default App;
